import React, { useState } from 'react'

const ProductForm = () => {
    const [product, setProduct] = useState({
        title: '',
        price: 0,
        description: ''
    });

    const handleSubmit = e => {
        e.preventDefault();

    }

    return (
        <div>
            <form onSubmit={ handleSubmit }>
                <div>
                    <label htmlFor="title">Title:</label>
                    <input type="text" name="title" onChange={e => setProduct(e.target.value)} />
                </div>
                <div>
                    <label htmlFor="price">Price</label>
                    <input type="number" name="price" onChange={e => setProduct(e.target.value)}/>
                </div>
                <div>
                <label htmlFor="description">Description</label>
                <input type="text" name="description" onChange={e => setProduct(e.target.value)}/>
                </div>
                <button>Submit</button>
            </form>
        </div>
    )
}

export default ProductForm
